import React from 'react';
import avatar from '../../assets/satwinder.png';
function Certificate() {
  const aws = ["aws1.png","aws2.png","aws3.png"]
  const azure = ["azure1.png","azure2.png"]
  return (

    <section className=" p-5 bg-dark" id="about">
    <h2 className='m-5'>
      Certifications
    </h2>

    <h3 className='m-5'>
      Aws Certifications
    </h3> 
    <article className='bg-black'>
    <div className='d-md-flex'>
      {aws.map(aws =>(
        <img src={require(`../../assets/images/certifications/${aws}`)}
        className='mx-2'
      style={{height:"260px",width:"260px"}}
      ></img>
      ))} 
    </div>
    </article>
    <h3 className='m-5'>
      Azure Certifications
    </h3> 
    <article className='bg-black'>
    <div className='d-md-flex'>
      {azure.map(azure =>(
        <img src={require(`../../assets/images/certifications/${azure}`)}
        className='mx-5'
        style={{height:"260px",width:"260px"}}
        ></img>
      ))} 
    </div>
    </article>
  </section>
  );
}

export default Certificate;
